import React, {useState, useEffect} from 'react'
import axios from 'axios'
function App() {
  const [ coins,setCoins] = useState([])
  useEffect(()=>{
    axios.get().then((response)=>{
      setCoins(response.data);
      console.log(response.data[0])

    }).catch((error)=>{
      console.log(error)
    })
  }, [])
  return (
   <>
   Yoo
   </>
  );
}

export default App;
